import React from 'react'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from "../components/header/header"
import Footer from "../components/footer/footer"
import Nav from "../components/navigation/nav"
import Slider from "../components/slider/slider"
import Home from "./home/home"
import History from './department/history/history';
import MyMap from './contacts/contacts';
import Staff from './department/staff/staff';
import LoadingScreen from './LoadingScreen';



const Main = () => {
    const [loading, setLoading] = useState(true);

    useEffect(() => {
      // Your code to fetch data or load assets
      setLoading(false); // Set loading to false when done
    }, []);
    return (
        <div>
            {loading ? <LoadingScreen /> : <div>Your main content goes here</div>}
            <Router>
                <div>
                    <Header />
                    <Nav />
                    <Slider />
                    <Routes>
                        <Route path="/" element={<Home />} />
                        <Route path="/history" element={<History />} />
                        <Route path="/contacts" element={<MyMap />}></Route>
                        <Route path="/staff" element={<Staff />}></Route>
                    </Routes>
                    <Footer/>
                </div>
            </Router>


        </div>
    )
}
export default Main
